// frontend/src/App.js

import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('/').then(response => response.text()).then(data => {
      setMessage(data);
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Online Bookstore</h1>
        <p>{message}</p>
      </header>
    </div>
  );
}

export default App;
